el/image/main_bg.gif); height: 32px; background-position: 0% 0%; background-repeat: no-repeat no-repeat;\"><h2 style=\"margin-top: 0px; margin-bottom: 0px; color: rgb(0, 91, 181); font-size: 14px; padding: 0px;\">酒店交通位置</h2></div><div class=\"main_hobox\" style=\"padding: 15px 10px 15px 15px; margin: 0px; border-color: rgb(205, 205, 205); border-width: 1px; border-bottom-style: solid; border-left-style: solid; border-right-style: solid;\"><p style=\"margin-bottom: 0px; padding: 0px; line-height: 1.6em; font-family: simsun; color: rgb(102, 102, 102);\">酒店位于朝阳公园附近，北邻机场高速，西接东四环路，东衔东五环，地理位置优越。- 距离天安门10公里，乘坐出租车约20-30分钟；- 距离国贸6公里，乘坐出租车约15分钟；- 距离朝阳公园2公里，乘坐出租车约5分钟；- 距离燕莎7公里，乘坐出租车约15分钟；- 距离北京站10公里，乘坐出租车约20-30分钟；- 距离首都国际机场25公里，乘坐出租车约30分钟。</p></div></div><div class=\"ho_box\" id=\"ho_box3\" style=\"padding: 0px; margin: 15px 0px 0px; color: rgb(19, 19, 19); font-family: SimSun, arial, Verdana, Geneva, Helvetica; line-height: 20px;\"><div class=\"top_hobox\" style=\"padding: 0px 0px 0px 15px; margin: 0px; line-height: 32px; background-image: url(http://2013-0127-2145:8080/ziteng/page/zthotel/image/main_bg.gif); height: 32px; background-position: 0% 0%; background-repeat: no-repeat no-repeat;\"><h2 style=\"margin-top: 0px; margin-bottom: 0px; color: rgb(0, 91, 181); font-size: 14px; padding: 0px;\">北京中康国际酒店酒店简介</h2></div><div class=\"main_hobox\" style=\"padding: 15px 10px 15px 15px; margin: 0px; border-color: rgb(205, 205, 205); border-width: 1px; border-bottom-style: solid; border-left-style: solid; border-right-style: solid;\"><p style=\"margin-bottom: 0px; padding: 0px; line-height: 1.6em; font-family: simsun; color: rgb(102, 102, 102);\">　　中康国际酒店由中康集团投资管理，是一座豪华型精品商务型酒店。酒店各类型客房、宴会厅及各类会议中心。客房豪华宽敞，配备有完善的现代化商务设施。大宴会厅可容纳500人同时用餐或举行会议，三个不同规格的会议中心配有先进的会议设施。　　独具风味的御海堂中餐厅、法式铁板烧、亚洲熟食餐厅以及维品吧，荟萃了世界各地的精品美食。设计时尚典雅的皇家会KTV夜总会，拥有32间包房，让宾客在引吭高歌的同时，放松心情。　　酒店开业时间2008年8月5日，楼高10层，客房总数209间（套）。</p></div></div>', '酒店政策：通常酒店的入住时间为14：00，离店时间为正午12：00。如提前入住或推迟离店，均需酌情加收一定费用。', 'page/zthotel/home011/2013