le: solid; border-left-style: solid; border-right-style: solid;\"><p style=\"padding: 0px; margin-bottom: 0px; line-height: 1.6em; font-family: simsun; color: rgb(102, 102, 102);\">　　中康国际酒店由中康集团投资管理，是一座豪华型精品商务型酒店。酒店各类型客房、宴会厅及各类会议中心。客房豪华宽敞，配备有完善的现代化商务设施。大宴会厅可容纳500人同时用餐或举行会议，三个不同规格的会议中心配有先进的会议设施。　　独具风味的御海堂中餐厅、法式铁板烧、亚洲熟食餐厅以及维品吧，荟萃了世界各地的精品美食。设计时尚典雅的皇家会KTV夜总会，拥有32间包房，让宾客在引吭高歌的同时，放松心情。　　酒店开业时间2008年8月5日，楼高10层，客房总数209间（套）。</p></div></div>', '', '', null, '0', '0', null, null, null, null, null, '116.357136,39.96982', null, null, null), ('32', '是否萨菲', null, '是打发', '212', '一星级', '撒的发的是否', null, '北京', '', null, null, null, null, '\n      Go ahead…1212sfdsfsdaf', '', 'page/upload/image/hotel/1401882626814.jpg', null, '0', '0', null, null, null, null, null, '', null, null, null);
